import React from 'react';

const folders = [
  { id: 1, name: 'mail', img: './icons/mail.png' },
  { id: 2, name: 'messages', img: './icons/message.png' },
  { id: 3, name: 'linkedin', img: './icons/linkedin.png' },
];

function Folder() {
  return <div className="folder-container"></div>;
}

export default Folder;
